import React, { useEffect } from "react";

const events = [
  {
    id: 1,
    type: "Technical",
    name: "Coding Contest",
    description: "Compete in a timed coding contest and solve algorithmic challenges.",
    image: "/media/image.png",
  },
  {
    id: 2,
    type: "Technical",
    name: "Hackathon",
    description: "Develop innovative solutions to real-world problems in teams.",
    image: "/media/image.png",
  },
  {
    id: 3,
    type: "Technical",
    name: "Debugging Challenge",
    description: "Test your debugging skills to fix code issues within a time limit.",
    image: "/media/image.png",
  },
];
const handleLinkClick = (event) => {
  event.preventDefault();
  const targetId = event.target.getAttribute('href').slice(1);
  const targetElement = document.getElementById(targetId);
  if (targetElement) {
    targetElement.scrollIntoView({ behavior: 'smooth' });
  }
};

const Events = () => {
  useEffect(() => {
    const observer = new IntersectionObserver(
      (entries) => {
        entries.forEach((entry) => {
          if (entry.isIntersecting) {
            entry.target.classList.add("zigzag-animate");
          } else {
            entry.target.classList.remove("zigzag-animate");
          }
        });
      },
      { threshold: 0.5 } // Trigger animation when 50% of the card is visible
    );

    const eventCards = document.querySelectorAll(".event-card");
    eventCards.forEach((card) => observer.observe(card));

    return () => observer.disconnect();
  }, []);

  return (
    <>
      <style>{`
        body {
          margin: 0;
          padding: 0;
          overflow-x: hidden;
          font-family: 'Poppins', sans-serif;
          background: black;
        }

        .navbar {
          position: fixed;
          top: 0;
          left: 0;
          width: 100%;
          height: 60px;
          background-color: rgba(0, 0, 0, 0.9);
          display: flex;
          justify-content: space-between;
          align-items: center;
          z-index: 1000;
          padding: 0 20px;
          box-shadow: 0 4px 6px rgba(0, 0, 0, 0.3);
        }

        .navbar a {
          text-decoration: none;
          color: white;
          font-size: 1.2rem;
          font-weight: 600;
          margin: 0 10px;
        }

        .navbar a:hover {
          text-decoration: underline;
        }

        .events-container {
          display: flex;
          flex-direction: column;
          scroll-snap-type: y mandatory; /* Enable full-page snapping */
          overflow-y: scroll;
          height: 100vh; /* Full viewport height for scrolling */
        }

        .event-card {
          display: flex;
          flex-direction: column;
          align-items: center;
          justify-content: center;
          height: 100vh; /* Full viewport height for each event */
          padding: 20px;
          background: rgba(255, 255, 255, 0.1);
          scroll-snap-align: start; /* Snap each card to the viewport */
          box-sizing: border-box;
          opacity: 0; /* Hidden by default */
          transform: translateX(-100%); /* Initial position for zigzag */
          transition: all 0.5s ease-in-out; /* Smooth transition */
        }

        .zigzag-animate {
          opacity: 1; /* Fade in */
          transform: translateX(0); /* Bring to normal position */
          animation: zigzag 0.8s ease-in-out forwards; /* Trigger zigzag animation */
        }

        @keyframes zigzag {
          0% {
            transform: translateX(-100%) translateY(0); /* Start from left */
          }
          25% {
            transform: translateX(20%) translateY(-10%); /* Move right and up */
          }
          50% {
            transform: translateX(-20%) translateY(10%); /* Move left and down */
          }
          75% {
            transform: translateX(10%) translateY(-5%); /* Move right slightly */
          }
          100% {
            transform: translateX(0) translateY(0); /* End at normal position */
          }
        }

        .event-image {
          width: 60%; /* Increased size */
          height: 50%; /* Increased height */
          overflow: hidden;
        }

        .event-image img {
          width: 100%;
          height: 100%;
          object-fit: cover;
          border-radius: 10px;
        }

        .event-details {
          padding: 20px;
          color: white;
          text-align: center;
        }

        .event-title {
          font-size: 2.5rem;
          font-weight: 700;
          margin: 20px 0;
        }

        .event-description {
          font-size: 1.2rem;
          font-weight: 300;
          margin: 20px 0;
        }

        .register-btn {
          padding: 15px 30px;
          background-color: white;
          color: black;
          border: none;
          border-radius: 10px;
          font-size: 1.2rem;
          font-weight: 600;
          cursor: pointer;
          transition: all 0.3s ease-in-out;
        }

        .register-btn:hover {
          background-color: black;
          color: white;
          border: 2px solid white;
        }

        @media (max-width: 768px) {
          .event-image {
            width: 90%; /* Increased size for smaller screens */
            height: 50%;
          }

          .event-title {
            font-size: 1.8rem; /* Smaller text for mobile */
          }

          .event-description {
            font-size: 1rem;
          }

          .register-btn {
            font-size: 1rem;
          }
        }
      `}</style>

      <div className="navbar">
        <a href="#home" onClick={handleLinkClick}>Home</a>
        <a href="#events" onClick={handleLinkClick}>Events</a>
        <a href="#schedule" onClick={handleLinkClick}>Schedule</a>
        <a href="#contact" onClick={handleLinkClick}>Contact</a>
      </div>

      <div className="events-container" id="events">
        {events.map((event) => (
          <div className="event-card" key={event.id}>
            <div className="event-image">
              <img src={event.image} alt={event.name} />
            </div>
            <div className="event-details">
              <h1 className="event-title">{event.name}</h1>
              <p className="event-description">{event.description}</p>
              <button className="register-btn">Register Now</button>
            </div>
          </div>
        ))}
      </div>
    </>
  );
};

export default Events;
